"use strict";(self.webpackChunkgiveth_docs=self.webpackChunkgiveth_docs||[]).push([[8020],{7545:e=>{e.exports=JSON.parse('{"pluginId":"dapps","version":"current","label":"Pr\xf3ximo","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"dapps":[{"type":"category","label":"Giveth.io Guides","items":[{"type":"link","label":"Intro to Giveth.io","href":"/pt/dapps/givethIO","docId":"givethIO"},{"type":"link","label":"Come\xe7ando","href":"/pt/dapps/gettingStarted","docId":"gettingStarted"},{"type":"category","label":"For Donors","collapsed":true,"items":[{"type":"link","label":"Como fa\xe7o para doar para um projeto?","href":"/pt/dapps/projectdonating","docId":"projectdonating"},{"type":"link","label":"Doando com Metamask","href":"/pt/dapps/donatingmetamask","docId":"donatingmetamask"},{"type":"link","label":"MultiSig Wallets on Giveth","href":"/pt/dapps/multisigs","docId":"multisigs"},{"type":"link","label":"Importar a chave privada do Torus para a Metamask","href":"/pt/dapps/importTorusMM","docId":"importTorusMM"}],"collapsible":true,"href":"/pt/dapps/projectdonating"},{"type":"category","label":"For Project Owners","collapsed":true,"items":[{"type":"link","label":"Criar um projeto","href":"/pt/dapps/createproject","docId":"createproject"},{"type":"link","label":"Guia de Garantia de Qualidade do Projeto","href":"/pt/dapps/listedUnlisted","docId":"listedUnlisted"},{"type":"link","label":"Diretrizes e Processos de Verifica\xe7\xe3o do Projeto","href":"/pt/dapps/projectVerification","docId":"projectVerification"},{"type":"link","label":"Adding Updates to Your Project","href":"/pt/dapps/projectUpdates","docId":"projectUpdates"}],"collapsible":true,"href":"/pt/dapps/createproject"},{"type":"category","label":"GIVeconomy","items":[{"type":"link","label":"GIVbacks","href":"/pt/giveconomy/givbacks","docId":"givbacks"},{"type":"link","label":"GIVstream","href":"/pt/giveconomy/givstream","docId":"givstream"},{"type":"link","label":"GIVpower","href":"/pt/giveconomy/givpower","docId":"givpower"},{"type":"category","label":"GIVgarden","items":[{"type":"link","label":"Terms & Conditions for Submitting or Challenging a Proposal","href":"/pt/giveconomy/termsForProposals","docId":"termsForProposals"}],"collapsed":true,"collapsible":true,"href":"/pt/giveconomy/givgarden"},{"type":"category","label":"GIVfarm","items":[{"type":"link","label":"Regen Farms","href":"/pt/regenFarms","docId":"regenFarms"},{"type":"link","label":"The Angel Vault","href":"/pt/angelVault","docId":"angelVault"}],"collapsed":true,"collapsible":true,"href":"/pt/giveconomy/givfarm"},{"type":"link","label":"GIVdrop","href":"/pt/giveconomy/givdrop","docId":"givdrop"}],"collapsed":true,"collapsible":true,"href":"/pt/giveconomy/"},{"type":"link","label":"Quadratic Funding","href":"/pt/quadraticfunding","docId":"quadraticfunding"},{"type":"link","label":"The Givers PFP Collection","href":"/pt/dapps/giverspfp","docId":"giverspfp"},{"type":"link","label":"$nice Token","href":"/pt/giveconomy/niceToken","docId":"niceToken"},{"type":"link","label":"Responsible Disclosure","href":"/pt/security/responsible-disclosure","docId":"disclosure"},{"type":"link","label":"Solu\xe7\xe3o de problemas","href":"/pt/dapps/troubleshooting","docId":"troubleshooting"},{"type":"category","label":"Guia do desenvolvedor","items":[{"type":"link","label":"Contribuindo para o Desenvolvimento da Giveth","href":"/pt/dapps/contributors","docId":"contributors"},{"type":"link","label":"Installing Giveth.io for Local Development","href":"/pt/dapps/givethioinstallation","docId":"givethioinstallation"},{"type":"category","label":"Giveth TRACE (Deprecated)","items":[{"type":"link","label":"Instalando Giveth TRACE para Desenvolvimento Local","href":"/pt/dapps/TRACEinstallation","docId":"TRACEinstallation"},{"type":"link","label":"Implementa\xe7\xe3o de seguran\xe7a da Giveth Bridge","href":"/pt/dapps/bridgeSecurity","docId":"bridgeSecurity"},{"type":"link","label":"Processo de Desenvolvimento","href":"/pt/dapps/developmentProcess","docId":"developmentProcess"}],"collapsed":true,"collapsible":true},{"type":"link","label":"Regen Farm Smart Contract Guide","href":"/pt/dapps/regenFarmContracts","docId":"regenFarmContracts"}],"collapsed":true,"collapsible":true},{"type":"category","label":"Giveth TRACE (Deprecated)","items":[{"type":"link","label":"Giveth Entidades e Fun\xe7\xf5es","href":"/pt/dapps/entitiesAndRoles","docId":"entitiesAndRoles"},{"type":"link","label":"Colocando seu Projeto na TRACE","href":"/pt/dapps/makeTraceableProject","docId":"makeTraceableProject"},{"type":"link","label":"Deixando Traces (anteriormente Criando Milestones)","href":"/pt/dapps/leavingTraces","docId":"leavingTraces"},{"type":"link","label":"Documento T\xe9cnico","href":"/pt/technicalWhitePaper","docId":"technicalWhitePaper"},{"type":"link","label":"Taxas de C\xe2mbio","href":"/pt/dapps/exchangeRates","docId":"exchangeRates"},{"type":"link","label":"Informa\xe7\xf5es T\xe9cnicas de Contratos, Bridges e Multisigs","href":"/pt/dapps/traceContracts","docId":"traceContracts"}],"collapsed":true,"collapsible":true,"href":"/pt/dapps/introTrace"}],"collapsed":true,"collapsible":true,"href":"/pt/dapps/"}]},"docs":{"angelVault":{"id":"angelVault","title":"The Angel Vault","description":"O Angel Vault \xe9 uma posi\xe7\xe3o Univ3 estrategicamente gerida e estruturada para proteger o GIV da volatilidade descendente. Ele \xe9 gerenciado por nosso multisig do Angel Vault, um multisig de 4/7 dos membros da equipe principal da Giveth e dois membros para o ICHI. Para saber mais sobre Angel Vaults e como eles funcionam, consulte a documenta\xe7\xe3o do ICHI..","sidebar":"dapps"},"bridgeSecurity":{"id":"bridgeSecurity","title":"Implementa\xe7\xe3o de seguran\xe7a da Giveth Bridge","description":"Uma vis\xe3o t\xe9cnica geral dos recursos, fun\xe7\xf5es e teoria por tr\xe1s da seguran\xe7a da Giveth Bridge.","sidebar":"dapps"},"contributors":{"id":"contributors","title":"Contribuindo para o Desenvolvimento da Giveth","description":"A Giveth atualmente mant\xe9m tr\xeas produtos que se concentram em gerenciamento de financiamento, doa\xe7\xf5es P2P e economias em tokens DeFi For-Good. Essas s\xe3o as Giveth TRACE, Giveth.io e GIVeconomy, respectivamente.","sidebar":"dapps"},"createproject":{"id":"createproject","title":"Criar um projeto","description":"Contemple a vis\xe3o para o seu projeto","sidebar":"dapps"},"crypto":{"id":"crypto","title":"Doa\xe7\xf5es de criptomoedas","description":"O que \xe9 e por que criptomoeda?"},"developmentProcess":{"id":"developmentProcess","title":"Processo de Desenvolvimento","description":"Essa se\xe7\xe3o detalha o processo de desenvolvimento da Giveth TRACE, implanta\xe7\xf5es e como a mesclagem e o teste s\xe3o tratados.*","sidebar":"dapps"},"disclosure":{"id":"disclosure","title":"Responsible Disclosure","description":"Smart Contract security","sidebar":"dapps"},"donatingmetamask":{"id":"donatingmetamask","title":"Doando com Metamask","description":"Vamos orient\xe1-lo no processo de fazer uma doa\xe7\xe3o de criptomoedas via Metamask aqui. Se voc\xea n\xe3o tem uma carteira Metamask, bem, ent\xe3o voc\xea deve ir ao site da Metamask e aprender como obter uma!","sidebar":"dapps"},"entitiesAndRoles":{"id":"entitiesAndRoles","title":"Giveth Entidades e Fun\xe7\xf5es","description":"O conte\xfado e as ideias foram modificados a partir desse excelente artigo \u201cUma vis\xe3o geral do aplicativo de doa\xe7\xf5es\u201d, de autoria de Kris Decoodt em 2017. Muitas coisas foram revisadas e modificadas desde 2017. Aqui detalhamos o como est\xe1 o DApp em 2022.","sidebar":"dapps"},"exchangeRates":{"id":"exchangeRates","title":"Taxas de C\xe2mbio","description":"Quando voc\xea deixa uma Trace dentro do Giveth TRACE, voc\xea pode inserir um valor em ether ou em moeda fiduci\xe1ria. Nosso sistema calcula automaticamente a taxa de convers\xe3o com base na data da Trace.","sidebar":"dapps"},"faq":{"id":"faq","title":"Perguntas Frequentes","description":"O que \xe9 Torus? Para obter a resposta mais detalhada, consulte https//app.tor.us/"},"gettingStarted":{"id":"gettingStarted","title":"Come\xe7ando","description":"Giveth.io \xe9 uma plataforma onde voc\xea pode facilmente apoiar projetos com criptomoedas e que voc\xea \u2764\ufe0f. Ou crie seu pr\xf3prio projeto e aceite financiamento de um p\xfablico mundial.","sidebar":"dapps"},"givbacks":{"id":"givbacks","title":"GIVbacks","description":"GIVbacks \xe9 um conceito revolucion\xe1rio que recompensa doadores para projetos verificados com tokens GIV. Ao doar para projetos verificados durante uma rodada de GIVbacks, voc\xea se torna eleg\xedvel para receber recompensas GIV ap\xf3s o t\xe9rmino da rodada e o GIV estar\xe1 pronto para ser coletado. Voc\xea pode acompanhar as  informa\xe7\xf5es ao vivo --- incluindo cronograma de rodadas e o seu GIV dispon\xedvel para ser coletado. --- na p\xe1gina GIVbacks.","sidebar":"dapps"},"givdrop":{"id":"givdrop","title":"GIVdrop","description":"O GIVdrop foi projetado para impulsionar a GIVeconomy distribuindo tokens GIV para a trusted seed da Giveth - filantropos de cryptomoedas, usu\xe1rios e construtores da Giveth, membros da Blockchain4Good DAO e outros parceiros do ecossistema. Clique aqui para verificar sua elegibilidade para o GIVdrop ou para reinvindic\xe1-los.","sidebar":"dapps"},"giveconomy":{"id":"giveconomy","title":"GIVeconomy","description":"A Giveth est\xe1 construindo uma cultura de doa\xe7\xe3o que capacita e recompensa aqueles que doam \u2013 para projetos, para a sociedade e para o mundo. Nosso objetivo \xe9 inspirar nossa comunidade a participar de um ecossistema de apoio coletivo, abund\xe2ncia e cria\xe7\xe3o de valor. Bem-vindo ao GIVeconomy.","sidebar":"dapps"},"giverspfp":{"id":"giverspfp","title":"The Givers PFP Collection","description":"\u201cThe Givers\u201d NFT\u2019s are not just NFT\u2019s but integrated Giveth PFPs! Giveth\'s first PFP collection was a community proposed initiative begun in March 2022. The intention of the PFP collection is to raise funds for the Giveth DAO and continue our mission of building the Future of Giving. The Givers was launched for public minting on March 24, 2023 at 11am CST.","sidebar":"dapps"},"givethIO":{"id":"givethIO","title":"Intro to Giveth.io","description":"O Giveth.io, lan\xe7ado em mar\xe7o de 2021, oferece uma maneira simples e objetiva de o mundo doar para projetos ben\xe9ficos por meio do Ethereum Blockchain.","sidebar":"dapps"},"givethioinstallation":{"id":"givethioinstallation","title":"Installing Giveth.io for Local Development","description":"This guide will document the steps to set up and run Giveth.io locally for the purposes of development. The setup process was documented using Ubuntu 20.04 LTS.","sidebar":"dapps"},"givethMatchingPool":{"id":"givethMatchingPool","title":"Giveth Matching Pool","description":"Giveth Matching Pool est\xe1 arrecadando fundos para distribuir a projetos verificados na Giveth. \xc9 perfeito para doadores que desejam ter um amplo impacto em bens p\xfablicos enquanto s\xe3o recompensados com GIVbacks."},"givfarm":{"id":"givfarm","title":"GIVfarm","description":"O GIVfarm foi lan\xe7ado em 24 de dezembro de 2021. 3,5% do fornecimento total de tokens, 35 milh\xf5es de GIV, foram alocados para a primeira rodada GIVfarm de 6 meses, enquanto 65 milh\xf5es de tokens s\xe3o mantidos em uma multisig para futura provis\xe3o de liquidez.","sidebar":"dapps"},"givgarden":{"id":"givgarden","title":"GIVgarden","description":"A Giveth escolheu a plataforma de governan\xe7a Gardens DAO desenvolvida pela 1hive para permitir que os detentores de tokens GIV possam guiar o futuro da DAO e alocar fundos para projetos que est\xe3o alinhados com sua miss\xe3o, vis\xe3o e valores. Nosso exclusivo Giveth Garden (Jardim Giveth) foi apropriadamente chamado de \u201cGIVgarden\u201d e \xe9 implantado na Gnosis Chain (antiga xDai Network). As principais ferramentas utilizadas para governan\xe7a no GIVgarden s\xe3o os Convicting Voting e Tao Voting.","sidebar":"dapps"},"givpower":{"id":"givpower","title":"GIVpower","description":"GIVpower foi criado para construir uma rela\xe7\xe3o ganha-ganha entre projetos e doadores. Os detentores de GIV obt\xeam GIVpower e ganham um rendimento quando apostam e - se escolherem - bloqueiam o GIV no GIVfarm. Eventualmente, eles poder\xe3o usar seu GIVpower para \u201cimpulsionar\u201d projetos na Giveth e ajudar a melhorar sua classifica\xe7\xe3o. Os projetos mais bem classificados receber\xe3o benef\xedcios na plataforma. Inicialmente, seus doadores receber\xe3o mais GIVbacks e, eventualmente, receber\xe3o fundos correspondentes e outros benef\xedcios.","sidebar":"dapps"},"givstream":{"id":"givstream","title":"GIVstream","description":"Bem-vindo ao GIViverso em expans\xe3o! A GIVstream alinha os membros da comunidade com o sucesso de longo prazo da Giveth e da GIVeconomy. Com a GIVstream, aqueles que agregam valor ao GIVEconomy, recebem GIVs continuamente por at\xe9 5 anos a partir da data de lan\xe7amento da GIVeconomy. A GIVeconomy come\xe7a humildemente, mas com o passar do tempo, o GIViverso se expande: Mais GIVs se tornam l\xedquidos e s\xe3o transmitidos para nossa comunidade de GIVernautas.","sidebar":"dapps"},"importTorusMM":{"id":"importTorusMM","title":"Importar a chave privada do Torus para a Metamask","description":"Embora a carteira Torus seja uma \xf3tima op\xe7\xe3o para iniciantes em criptomoedas, pode ser mais dif\xedcil de usar ao interagir com aplicativos descentralizados (dApps). Os usu\xe1rios da Giveth t\xeam a oportunidade de ganhar GIV interagindo com a GIVeconomy. Os usu\xe1rios do Torus podem reivindicar GIVbacks, participar do GIVfarm, reivindicar seu GIVstream e reivindicar seu GIVdrop (se eleg\xedvel), mas os usu\xe1rios do MetaMask se beneficiam de uma experi\xeancia de usu\xe1rio mais simplificada. Al\xe9m disso, atualmente o GIVgarden n\xe3o inclui a integra\xe7\xe3o da carteira Torus. Queremos capacitar os rec\xe9m-chegados ao mundo cripto os meios para se integrarem totalmente \xe0 comunidade web3. MetaMask \xe9 uma carteira cripto segura e um gateway altamente otimizado para aplicativos blockchain. O objetivo deste guia \xe9 explicar como importar a chave privada do Torus para o MetaMask, permitindo assim uma funcionalidade mais ampla. Para obter instru\xe7\xf5es sobre como come\xe7ar a usar uma carteira MetaMask, confira este artigo da equipe Metamask.","sidebar":"dapps"},"installGIVeconomy":{"id":"installGIVeconomy","title":"Instalando o front-end do GIVeconomy","description":"Voc\xea pode encontrar o reposit\xf3rio do Github contendo o front-end GIVeconomy em https://github.com/Giveth/liquidity-mining-dapp."},"introTrace":{"id":"introTrace","title":"Introdu\xe7\xe3o ao Giveth TRACE","description":"A Giveth est\xe1 reestruturando as doa\xe7\xf5es de caridade, criando plataformas totalmente gratuitas e de c\xf3digo aberto, constru\xeddas na Blockchain Ethereum. O Giveth TRACE elimina a burocracia e permite que os Criadores - respons\xe1veis por desenvolver iniciativas - criem um alto n\xedvel de transpar\xeancia e responsabilidade para os Doadores. A hierarquia b\xe1sica de doa\xe7\xe3o de Comunidades, Campanhas e Rastreios permite que os usu\xe1rios especifiquem o escopo de sua doa\xe7\xe3o. Existem v\xe1rias fun\xe7\xf5es de revisores e pontos de verifica\xe7\xe3o de seguran\xe7a que permitem que Doadores e Criadores usem nosso DApp com confian\xe7a. Voc\xea pode ler mais sobre os componentes b\xe1sicos e a l\xf3gica por tr\xe1s do nosso DApp (Aplicativo de Doa\xe7\xe3o) nesse post.","sidebar":"dapps"},"leavingTraces":{"id":"leavingTraces","title":"Deixando Traces (anteriormente Criando Milestones)","description":"Bem-Vindo! Se voc\xea \xe9 super novo no Giveth, entre no canal #\ud83d\udd28contribua no Discord. Voc\xea pode se apresentar e tirar d\xfavidas l\xe1! Este \xe9 um documento vivo e mudar\xe1 \xe0 medida que os bugs forem corrigidos e os recursos adicionados ao DApp","sidebar":"dapps"},"listedUnlisted":{"id":"listedUnlisted","title":"Guia de Garantia de Qualidade do Projeto","description":"Para garantir a qualidade dos projetos em nosso DApp, implementamos um processo de pr\xe9-sele\xe7\xe3o de projetos antes de serem apresentados na p\xe1gina inicial da Giveth. Todos os novos projetos s\xe3o inicialmente n\xe3o listados at\xe9 que sejam revisados e aprovados por um Giveth Unicorn. Projetos n\xe3o listados ainda podem receber doa\xe7\xf5es e podem ser acessados atrav\xe9s da URL do projeto. No entanto, apenas os projetos listados aparecer\xe3o na p\xe1gina inicial e na p\xe1gina de projetos da Giveth, usando nossas funcionalidades de classifica\xe7\xe3o, filtro e pesquisa.","sidebar":"dapps"},"makeTraceableProject":{"id":"makeTraceableProject","title":"Colocando seu Projeto na TRACE","description":"Este guia mostrar\xe1 como tornar seu projeto rastre\xe1vel. Analisaremos as etapas para primeiro verificar seu projeto e depois atualiz\xe1-lo para uma campanha no Giveth TRACE.","sidebar":"dapps"},"multisigs":{"id":"multisigs","title":"MultiSig Wallets on Giveth","description":"It is possible to use Giveth with your Safe Multisig Wallet. However there are a few steps to get setup and a few things to keep in mind. If you don\'t know what a multisig wallet is or how to make one, check out the Safe documentation for Getting Started with Multisig Wallets.","sidebar":"dapps"},"niceToken":{"id":"niceToken","title":"$nice Token","description":"O token $nice foi lan\xe7ado no terceiro trimestre de 2022 em um esfor\xe7o para promover doa\xe7\xf5es diretas \xe0 Giveth Organization.","sidebar":"dapps"},"projectdonating":{"id":"projectdonating","title":"Como fa\xe7o para doar para um projeto?","description":"Encontre um projeto que voc\xea goste.","sidebar":"dapps"},"projectUpdates":{"id":"projectUpdates","title":"Adding Updates to Your Project","description":"Are you the proud owner of a verified project on Giveth? If so, it\'s important to keep your donors in the loop and maintain your active status by posting updates every 3 months.","sidebar":"dapps"},"projectVerification":{"id":"projectVerification","title":"Diretrizes e Processos de Verifica\xe7\xe3o do Projeto","description":"A Giveth est\xe1 fazendo uso da verifica\xe7\xe3o de projetos para revisar a legitimidade de um projeto e recompensar os doadores desses projetos por meio do programa GIVbacks. Os propriet\xe1rios do projeto podem solicitar a verifica\xe7\xe3o aqui.","sidebar":"dapps"},"quadraticfunding":{"id":"quadraticfunding","title":"Quadratic Funding","description":"What is Quadratic Funding?","sidebar":"dapps"},"recurringDonation":{"id":"recurringDonation","title":"Recurring Donations","description":"On Giveth you can use the power of Superfluid to create recurring donations to projects. This allows you to provide continuous support over a long-period to your favourite projects. In this article we will explain the key concepts of recurring donations and how to interact with them on the Giveth Dapp."},"referral":{"id":"referral","title":"Giveth Referral Program","description":"The Giveth referral program is a way for users to earn rewards by inviting their friends and network to donate to impact projects. Since the launch of the GIVeconomy in 2020, donors can earn GIV tokens when they donate to verified projects thanks to our GIVbacks program. With our referral program, users can earn even more rewards!"},"regenFarmContracts":{"id":"regenFarmContracts","title":"Regen Farm Smart Contract Guide","description":"GIVeconomy is a collection of audited smart contracts which work together to provide capabilities, including: token streaming, airdropping, and various types of farming. Contracts and scripts can be found at the Giveth giv-token-contracts repository.","sidebar":"dapps"},"regenFarms":{"id":"regenFarms","title":"Regen Farms","description":"RegenFarms \xe9 a pr\xf3xima gera\xe7\xe3o de oportunidades de minera\xe7\xe3o de liquidez ReFi para DAOs e regens. Usando nossos contratos para a GIVfarm e a GIVstream, estamos capacitando outras DAOs para o lan\xe7amento de programas de incentivo \xe0 minera\xe7\xe3o de liquidez , \u201cRegenFarms\u201d, com streams pr\xf3prias.","sidebar":"dapps"},"styleguide":{"id":"styleguide","title":"Style Guide","description":"Giveth Design by @markoprljic."},"technicalWhitePaper":{"id":"technicalWhitePaper","title":"Documento T\xe9cnico","description":"O objetivo da nossa tecnologia \xe9 dar aos usu\xe1rios de criptomoedas a capacidade de doar sem esfor\xe7o para Campanhas focadas em tornar o mundo um lugar melhor. Eles podem usar a plataforma Giveth para encontrar essas Campanhas e doar diretamente, ou podem doar suas criptomoedas para uma causa e fazer com que um Delegado escolha uma Campanha ou Rastreamento apropriado para eles. Como alternativa aos sistemas tradicionais de doa\xe7\xe3o, nosso contrato Liquid_** Pledge_ permite que os Doadores recuperem sua promessa se discordarem de como suas doa\xe7\xf5es foram alocadas. Isso s\xf3 pode ocorrer antes de ser bloqueado em uma campanha para uma finalidade espec\xedfica.","sidebar":"dapps"},"termsForProposals":{"id":"termsForProposals","title":"Terms & Conditions for Submitting or Challenging a Proposal","description":"1. ACCEPTANCE OF TERMS","sidebar":"dapps"},"testing-guidelines":{"id":"testing-guidelines","title":"Diretrizes de teste da Giveth.io","description":"Este guia fornece uma estrutura para testar o DApp Giveth.io."},"testingGIVeconomy":{"id":"testingGIVeconomy","title":"Diretrizes de Teste GIVeconomy","description":"Este \xe9 um guia para cen\xe1rios completos de teste de usu\xe1rio para o GIVeconomy DApp. O teste deve ser feito no servidor de teste que pode ser encontrado em https://staging.giv.giveth.io/."},"torusonramp":{"id":"torusonramp","title":"Doar com moeda fiat atrav\xe9s do on-ramp da Torus","description":"Este guia o guiar\xe1 pelas etapas de doa\xe7\xe3o de sua moeda fiat - d\xf3lar - usando o Torus. Para fazer isso, voc\xea usar\xe1 um provedor de pagamento terceirizado para enviar seu dinheiro para a Torus, que \'recarregar\xe1\' sua carteira Torus com a criptomoeda escolhida. Esta cripto convertida ser\xe1 ent\xe3o doada para o projeto que voc\xea selecionou. Existem taxas associadas a esta convers\xe3o da Torus, bem como do provedor de terceiros que voc\xea escolher. Vamos orient\xe1-lo nas etapas, mas dependendo da sua moeda nativa, do provedor de pagamento que voc\xea usa e da criptomoeda para a qual est\xe1 convertendo, as coisas podem parecer um pouco diferentes."},"torusUserGuide":{"id":"torusUserGuide","title":"Usando a carteira Torus","description":"A carteira Torus \xe9 uma \xf3tima op\xe7\xe3o para iniciantes em criptomoedas. Usando a tecnologia web3, permite que voc\xea crie uma carteira Ethereum vinculada \xe0 sua identidade por meio da plataforma de m\xeddia social escolhida."},"traceContracts":{"id":"traceContracts","title":"Informa\xe7\xf5es T\xe9cnicas de Contratos, Bridges e Multisigs","description":"Contratos:","sidebar":"dapps"},"TRACEinstallation":{"id":"TRACEinstallation","title":"Instalando Giveth TRACE para Desenvolvimento Local","description":"Esse \xe9 um guia abrangente que mostrar\xe1 aos novos colaboradores sobre como executar o Giveth TRACE localmente. Estaremos lidando com 2 reposit\xf3rios encontrados no Github Giveth: o giveth-dapp para o front-end, feathers-giveth para a interface de contrato inteligente e banco de dados de back-end.","sidebar":"dapps"},"troubleshooting":{"id":"troubleshooting","title":"Solu\xe7\xe3o de problemas","description":"Se voc\xea est\xe1 tendo problemas t\xe9cnicos com o Giveth DApp, voc\xea pode encontrar uma solu\xe7\xe3o nesta p\xe1gina.","sidebar":"dapps"}}}')}}]);